import React, { useState } from "react";
import "./Dashboard.css";
import Main from "../Main/Main";
import CreateProposal from "./CreateProposal/CreateProposal";
import ExecuteProposal from "./ExecuteProposal/ExecuteProposal";
import TransferShares from "./TransferShares/TransferShares";
import RedeemShares from "./RedeemShares/RedeemShares";
const Dashboard = () => {
  const [activeComponent, setActiveComponent] = useState(null);

  return (
    <div>
      <aside>
        <div onClick={() => setActiveComponent("Create Proposal")}>
          <p>Create Proposal</p>
        </div>
        <div onClick={() => setActiveComponent("Excecute Proposal")}>
          <p>Execute Proposal</p>
        </div>
        <div onClick={() => setActiveComponent("Transfer Shares")}>
          <p>Transfer Shares</p>
        </div>
        <div onClick={() => setActiveComponent("Redeem Shares")}>
          <p>Redeem Shares</p>
        </div>
      </aside>

      <Main component={displayComponent} />
    </div>
  );
};
export default Dashboard;
